import React, { Component } from 'react';
import { Link, withRouter } from "react-router-dom";
import './Navigation';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = { collapsed: true };
    }
    render() {
        return (
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <Link className="navbar-brand" to="/">Navbar</Link>
                <button className="navbar-toggler" type="button" onClick={() => this.setState({ collapsed: !this.state.collapsed })}>
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div
                    className={this.state.collapsed ? 'navbar-collapse collapse' : 'navbar-collapse'}
                    id="navbar">
                    <ul className="navbar-nav mr-auto my-2 my-lg-0 navbar-nav-scroll">
                        <li className="nav-item">
                            <Link
                                className={`nav-link  ${this.props.location.pathname === "/" ? "active" : ""}`}
                                to="/">
                                Landing
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                className={`nav-link  ${this.props.location.pathname === "/products" ? "active" : ""}`}
                                to="/products">
                                Products
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                className=
                                {`
                                nav-link
                                ${this.props.location.pathname === "/order" ? "active" : ""}
                                `}
                                to="/order">
                                Order
                            </Link>
                        </li>
                        <li className="nav-item">
                            <Link
                                className=
                                {`
                                    nav-link
                                    ${this.props.location.pathname === "/cart" ? "active" : ""}
                                `}
                                to="/cart">
                                Cart
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>
        );
    }
}

export default withRouter(Navigation);
